     function borrowEthOnCompound(
        address payable _cEtherAddress,
        address _comptrollerAddress,
        address _cTokenAddress,
        address _underlyingAddress,
        uint256 _underlyingToSupplyAsCollateral
    ) public returns (uint) {

        ExternalContracts memory contracts;
        contracts.cEth = CEth(_cEtherAddress);
        contracts.comptroller = Comptroller(_comptrollerAddress);
        contracts.cToken = CErc20(_cTokenAddress);
        contracts.underlying = Erc20(_underlyingAddress);


        /* Now that we have declared our references to external contracts needed in this operation, we‚Äôll approve 
        a transfer of Dai from this contract to the protocol. 
        After the approve operation, we can mint some cDai. This is necessary when supplying Dai as collateral. */

        // Approve transfer of underlying
        contracts.underlying.approve(_cTokenAddress, _underlyingToSupplyAsCollateral);

        // Supply underlying as collateral, get cToken in return
        require(contracts.cToken.mint(_underlyingToSupplyAsCollateral) == 0, "CErc20.mint Error");


        /* Next, we ‚Äúenter‚Äù the Dai market. This is the way we indicate that we want to use our underlying Dai as 
        collateral, so we can borrow different assets from the protocol. */

        // Enter the market so you can borrow another type of asset
        address[] memory cTokens = new address[](1);
        cTokens[0] = _cTokenAddress;
        uint256[] memory errors = contracts.comptroller.enterMarkets(cTokens);
        if (errors[0] != 0) {
            revert("Comptroller.enterMarkets failed.");
        }

        /* Before we borrow ETH, we need to determine the maximum amount of ETH we can borrow. This is important because 
        if we try to borrow more than we are allowed to, the operation will fail. Also, if we borrow too close to the limit,
        our account will be liquidated. This is done by calling the getAccountLiquidity function on the protocol‚Äôs 
        comptroller contract. The amount gets logged by our Solidity event, so the Web3.js return value will show 
        the amount in its event logs. */
        // Get my account's total liquidity value in Compound
        (uint256 error, uint256 liquidity, uint256 shortfall) = contracts.comptroller
            .getAccountLiquidity(address(this));
        if (error != 0) {
            revert("Comptroller.getAccountLiquidity failed.");
        }
        require(shortfall == 0, "account underwater");
        require(liquidity > 0, "account has excess collateral");

        /* Next I have some code that logs things like the maximum borrow, the collateral factor and the borrow rate per 
        block. These are not necessary for the execution, but I wanted to illustrate how you would use them if needed. */
        // Borrowing near the max amount will result
        // in your account being liquidated instantly
        emit MyLog("Maximum ETH Borrow (borrow far less!)", liquidity);


                // Get the collateral factor for our collateral
        (
          bool isListed,
          uint collateralFactorMantissa
        ) = contracts.comptroller.markets(_cTokenAddress);
        emit MyLog('Collateral Factor', collateralFactorMantissa);

        // Get the amount of ETH added to your borrow each block
        uint borrowRateMantissa = contracts.cEth.borrowRatePerBlock();
        emit MyLog('Current ETH Borrow Rate', borrowRateMantissa);


        /* The last step in the borrow operation is to pass the amount of ETH that we want to borrow to the cToken contract‚Äôs 
        borrow function. We are also going to fetch how much we have borrowed using the borrowBalanceCurrent method on the cToken 
        contract. We‚Äôll return this value.*/
        // Borrow a fixed amount of ETH below our maximum borrow amount
        // TODO Use an argument in the function ?
        uint256 numWeiToBorrow = 20000000000000000; // 0.02 ETH

        // Borrow, then check the underlying balance for this contract's address
        contracts.cEth.borrow(numWeiToBorrow);

        uint256 borrows = contracts.cEth.borrowBalanceCurrent(address(this));
        emit MyLog("Current ETH borrow amount", borrows);

        return borrows;
    }


